import React from 'react';
import './App.css';
import { BrowserRouter, Route, Link } from 'react-router-dom';
import LivroLista from './LivroLista';
import LivroDados from './LivroDados';

function App() {
  return (
    <BrowserRouter>
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <Link className="navbar-brand" to="/">Minha Biblioteca</Link>
        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav">
            <li className="nav-item">
              <Link className="nav-link" to="/">Lista de Livros</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/livro-dados">Dados do Livro</Link>
            </li>
          </ul>
        </div>
      </nav>
      <div className="container">
        <Route exact path="/" component={LivroLista} />
        <Route path="/livro-dados" component={LivroDados} />
      </div>
    </BrowserRouter>
  );
}

export default App;
